#include <bits/stdc++.h>
using namespace std;

const int MAX = 101;
int arr[MAX] = {0};

int main()
{
    int n, m;
    cin >> n;
    for (int i = 0; i < n; i++) {
        cin >> m;
        arr[m]++;
    }

    int mx = arr[1];
    for (int i = 2; i <= MAX; i++) {
        if (mx < arr[i]) {
            mx = arr[i];
        }
    }

    cout << mx << endl;
	return 0;
}
